export default {
  props: {
    list: {
      type: Array,
      default() {
        return []
      }
    }
  },
  computed: {
    disabled() {
      return this.list.length <= 1
    },
    text() {
      const { list } = this
      return list.length <= 1 ? list[0] || '' : `共${list.length}人`
    }
  }
}
